import memoize from 'memoize-one';

export function create(styles) {
	return function createStyle() {
		return Object.keys(styles).reduce(function (finalStyles, key) {
			var val = styles[key];
			finalStyles[key] = typeof val === 'function' ? memoize(val) : val;
			return finalStyles;
		}, {});
	};
}
